import React, { Component } from 'react';
import rocketLogo from '../src/img/rocket-02.png';

const Abovefold = ({onRouteChange}) => {
    return (
      <div className="aboveFold">
      <h1>Prepare for the launch of the Rocket</h1>

      <div className="logo">
      <img className="rocketLogo" src={rocketLogo} alt="rocket logo"/>
      </div>
      <div className="cta">
      <button className="btn" onClick={() => props.onRouteChange('Ourstory')}>Our story</button>
      <button className="btn" onClick={() => props.onRouteChange('Fleece')}>The Fleece</button>
      </div>
      </div>
    )
}

export default Abovefold;
